INSERT INTO TI_B_GRP_MEB_PLATSVC (SYNC_SEQUENCE,MODIFY_TAG,TRADE_ID,PARTITION_ID,USER_ID,SERIAL_NUMBER,EC_USER_ID,EC_SERIAL_NUMBER,SERVICE_ID,SERV_CODE,BIZ_CODE,BIZ_NAME,START_DATE,END_DATE,UPDATE_TIME,UPDATE_STAFF_ID,UPDATE_DEPART_ID,REMARK,RSRV_NUM1,RSRV_NUM2,RSRV_NUM3,RSRV_NUM4,RSRV_NUM5,RSRV_STR1,RSRV_STR2,RSRV_STR3,RSRV_STR4,RSRV_STR5,RSRV_DATE1,RSRV_DATE2,RSRV_DATE3,RSRV_TAG1,RSRV_TAG2,RSRV_TAG3)
        SELECT  :SYNC_SEQUENCE,'2',:TRADE_ID, PARTITION_ID,USER_ID,SERIAL_NUMBER,EC_USER_ID,EC_SERIAL_NUMBER,SERVICE_ID,SERV_CODE,BIZ_CODE,BIZ_NAME,START_DATE,a.START_DATE - 1/24/3600,sysdate,UPDATE_STAFF_ID,UPDATE_DEPART_ID,'删除无效数据',RSRV_NUM1,RSRV_NUM2,RSRV_NUM3,RSRV_NUM4,RSRV_NUM5,RSRV_STR1,RSRV_STR2,RSRV_STR3,RSRV_STR4,RSRV_STR5,RSRV_DATE1,RSRV_DATE2,RSRV_DATE3,RSRV_TAG1,RSRV_TAG2,RSRV_TAG3
        FROM TF_B_TRADE_GRP_MEB_PLATSVC_BAK a
        WHERE trade_id=:TRADE_ID
        AND accept_month=:ACCEPT_MONTH
        AND not exists (SELECT 1 from TI_B_GRP_MEB_PLATSVC b
                        WHERE sync_sequence = TO_NUMBER(:SYNC_SEQUENCE)
                        AND b.user_id=a.user_id
                        and b.ec_user_id=a.ec_user_id
                        and b.service_id=a.service_id
                        and b.start_date=a.start_date
                        )